    detail= {"Figma, sketch, Photoshop, Adobe xd"}
    />
</div>  
{/*  secound card */ }

<div style={{left: '14rem'}} >
    <Card
    emoji = {Glasses}
    heading = {'Developer'}
    detail= {"html, css, javascript, react"}
    />
</div> 
{/*  third card */ }

<div style={{left: '14rem'}} >
    <Card
    emoji = {Humble}
    heading = {'UI/'}
    detail= {"html, css, javascript, react"}
    />
</div> 
</div>
</div>

    )
}
export default Services;
